import React from 'react';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Button from '@material-ui/core/Button';
import Grid from '@material-ui/core/Grid';
import logo from '../images/logo.png';

import service from '../services/CourseService';


export default function App () {

    const loadCourses = async () => {

        let courses = await service.getCourses();
        event.preventDefault();
    }

    return (
        <div>
        <AppBar color="paper" positionsticky="true">
        <Toolbar>

            <div align="center">
                <img src={logo} alt="Website Logo" width="75%"/>

                <Grid container direction="row" justify="space-evenly" alignItems="center">
                    <Button color="grey">Projects</Button>
                    <Button color="inherit" >Experience</Button>
                    <Button color="inherit" >Education</Button>
                    <Button color="inherit" >About</Button>
                    <Button color="inherit" >Contact</Button>
                </Grid>
            </div>

        </Toolbar>
        </AppBar>

        <h1 onload={loadCourses}></h1>
        </div>
    )
}
